import logo from './logo.svg';
import './App.css';

function App() {
  const text = <a href=''>friends</a>;
  const autumn = true;
  let month = 11;
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1 style={{
          color:'#DF8D98'
        }}>
          Hello, {text}!
        </h1>
        <p>
          Новый год через {31 + 15} дней.
        </p>
        <p>
          Сейчас {autumn ? 'осень' : 'не осень'}. Месяц {month && 'ноябрь'}.
          {null}
          {undefined}
          {true}
          {false}
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
